/*!40000 ALTER TABLE `wp_posts` DISABLE KEYS */;
INSERT INTO `wp_posts` VALUES (1,1,'2016-01-22 06:04:30','2016-01-22 06:04:30','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','trash','open','open','','hello-world','','','2016-01-22 06:04:48','2016-01-22 06:04:48','',0,'http://brittanymroczek.com/?p=1',0,'post','',1),(2,1,'2016-01-22 06:04:30','2016-01-22 06:04:30','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://brittanymroczek.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','open','open','','sample-page','','','2016-01-22 06:05:55','2016-01-22 06:05:55','',0,'http://brittanymroczek.com/?page_id=2',0,'page','',0),(3,1,'2016-01-22 06:04:38','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2016-01-22 06:04:38','0000-00-00 00:00:00','',0,'http://brittanymroczek.com/?p=3',0,'post','',0),(4,1,'2016-01-22 06:04:48','2016-01-22 06:04:48','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','inherit','open','open','','1-revision-v1','','','2016-01-22 06:04:48','2016-01-22 06:04:48','',1,'http://brittanymroczek.com/?p=4',0,'revision','',0),(5,1,'2016-01-22 06:05:55','2016-01-22 06:05:55','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://brittanymroczek.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','inherit','open','open','','2-revision-v1','','','2016-01-22 06:05:55','2016-01-22 06:05:55','',2,'http://brittanymroczek.com/?p=5',0,'revision','',0),(6,1,'2016-01-22 06:06:37','2016-01-22 06:06:37','285 n. 6th street\r\nbrooklyn, ny 11211\r\n360.556.7618\r\nbrittanymariemroczek@gmail.com','contact','','publish','open','open','','contact','','','2016-01-22 06:06:37','2016-01-22 06:06:37','',0,'http://brittanymroczek.com/?page_id=6',0,'page','',0),(7,1,'2016-01-22 06:06:37','2016-01-22 06:06:37','285 n. 6th street\r\nbrooklyn, ny 11211\r\n360.556.7618\r\nbrittanymariemroczek@gmail.com','contact','','inherit','open','open','','6-revision-v1','','','2016-01-22 06:06:37','2016-01-22 06:06:37','',6,'http://brittanymroczek.com/?p=7',0,'revision','',0),(8,1,'2016-01-22 06:07:19','2016-01-22 06:07:19','Brittany Mroczek is a New York based Hair Stylist who specializes in cutting and styling. Originally from the Pacific North West she continually seeks inspiration from its landscape.\r\nAfter moving to New York she landed her debut position at Sally Hershberger and Woodley and Bunny where she honed her cutting skills. After assisting in the Salon, she went on to assist Guido Palau during fashion week and continues to work with him internationally while simultaneously building her portfolio and clientele.\r\nBrittany’s work has been shown at galleries and featured internationally by a variety of publications including W, I Like My Style, Vogue, V, and New York Times Fashion Magazine as well as Purple TV, MOCA TV and SHOWstudio.\r\nBrittany was selected to be the Lead Hairstylist on the feature film, Beasts of the Southern Wild, which was nominated for four Academy Awards and won Best Picture.\r\nKnown for combining intuition, technicality, and conceptual thought she creates personalized haircuts and styles for artists, designers, writers and musicians. She continues to collaborate with photographers: Matthias Vriens-McGrath, Rob Kulisek, Gillian Steiner, and Robin Stein, As well as Directors: Benh Zeitlin, Julia Liu, Alexa Karolinski and Steve Hanft. She has lead presentations for designers such as: Eckhauslatta, Vaquera, Isabel Wilson, and Moses Gauntlette Cheng\r\nBrittany remains a devoted artist who enjoys the thrill of trend setting and forecasting backstage during Fashion Week. Her ability to remain calm and work efficiently in a fast pace environment makes her an inspiring team player.','bio','','publish','open','open','','bio','','','2016-01-22 06:07:19','2016-01-22 06:07:19','',0,'http://brittanymroczek.com/?page_id=8',0,'page','',0),(9,1,'2016-01-22 06:07:19','2016-01-22 06:07:19','Brittany Mroczek is a New York based Hair Stylist who specializes in cutting and styling. Originally from the Pacific North West she continually seeks inspiration from its landscape.\r\nAfter moving to New York she landed her debut position at Sally Hershberger and Woodley and Bunny where she honed her cutting skills. After assisting in the Salon, she went on to assist Guido Palau during fashion week and continues to work with him internationally while simultaneously building her portfolio and clientele.\r\nBrittany’s work has been shown at galleries and featured internationally by a variety of publications including W, I Like My Style, Vogue, V, and New York Times Fashion Magazine as well as Purple TV, MOCA TV and SHOWstudio.\r\nBrittany was selected to be the Lead Hairstylist on the feature film, Beasts of the Southern Wild, which was nominated for four Academy Awards and won Best Picture.\r\nKnown for combining intuition, technicality, and conceptual thought she creates personalized haircuts and styles for artists, designers, writers and musicians. She continues to collaborate with photographers: Matthias Vriens-McGrath, Rob Kulisek, Gillian Steiner, and Robin Stein, As well as Directors: Benh Zeitlin, Julia Liu, Alexa Karolinski and Steve Hanft. She has lead presentations for designers such as: Eckhauslatta, Vaquera, Isabel Wilson, and Moses Gauntlette Cheng\r\nBrittany remains a devoted artist who enjoys the thrill of trend setting and forecasting backstage during Fashion Week. Her ability to remain calm and work efficiently in a fast pace environment makes her an inspiring team player.','bio','','inherit','open','open','','8-revision-v1','','','2016-01-22 06:07:19','2016-01-22 06:07:19','',8,'http://brittanymroczek.com/?p=9',0,'revision','',0),(10,1,'2016-01-22 06:11:02','2016-01-22 06:11:02','<strong>[bpscheduler_booking_form]</strong>','appointments','','publish','open','open','','appointments','','','2016-01-22 07:36:26','2016-01-22 07:36:26','',0,'http://brittanymroczek.com/?page_id=10',0,'page','',0),(11,1,'2016-01-22 06:11:02','2016-01-22 06:11:02','{APPOINTY} ','appointments','','inherit','open','open','','10-revision-v1','','','2016-01-22 06:11:02','2016-01-22 06:11:02','',10,'http://brittanymroczek.com/?p=11',0,'revision','',0),(17,1,'2016-01